import React from 'react'
import { Col, Container, Row } from 'react-bootstrap';

function MovieDetails() {
return (
    <Container>
        <Row>
            <Col>
                <img src='' alt=''></img>
            </Col>
            <Col>
                <h2>
                    اسم الفيلم : 
                </h2>
            </Col>
        </Row>
    </Container>
)
}

export default MovieDetails ;
